import React, { Component } from 'react'

export default class MyComponent extends Component {
  constructor(props) {
    super(props)

    this.state = {
      username:"",
      password:"",
      login:false,
      token:""
    }
  }

  render() {
    return (
      <div>
        <form onSubmit={this.logine}>
          <div>
            <input
              type="text"
              name="username"
              value={username}
              onChange={this.changeHandler}
            />
          </div>
          <div>
            <input
              type="text"
              name="password"
              value={password}
              onChange={this.changeHandler}
            />
          </div>

          <button type="submit">Submit</button>
        </form>
      </div>
    )
  }
}
